    false,nt"url": null,nt"notes": "The digital data set delineates the outer
    boundary of each major discharge area evaluated as part of the study. These areas
    were used to refine estimates of ground-water discharge throughout the Death Valley
    regional flow system. As delineated, boundaries include all phreatophytic vegetation
    and moist soil areas within a discharge area. The boundaries were used to focus
    efforts associated with classifying the different vegetation and soil conditions
    within a discharge area.",nt"license_title": null,nt"extras": [{ntt"key":
